message:
🚨😨😖 Constituição rasgada | Desmoralização internacional - Justiça brasileira ocupa últimos lugares em ranking mundial sobre eficácia.

🎯✍🏻☢️ Justiça tupiniquim - liderada pelos iluminados e intocáveis ministros do 
STF (especialistas em 
●transgredir a Constituição Federal mediante canetadas ilimitadas ou julgamentos despropositados no plenário da Corte;
●violar a divisão dos poderes;
●agir como Poder Constituinte;
●impunidade dos criminosos de colarinho branco;
●relativismo progressista;
●identitarismo político;
●vilipêndio ao direito natural;
●ativismo judicial;
●usurpação de competências;
●inobservância do devido processo legal;
●persecução ideológica; etc.) - está entre as últimas colocações no ranking mundial que mede a eficácia do sistema judicial de 140 países. 

🚩💣😬 A pior pontuação do Brasil foi no índice que mede a imparcialidade, ficando à frente apenas da ditadura venezuela.

